    //extract each String that is separated by '|'
    //decode the String
    //store in toReturn container

    String toReturn = "";

    for (int i = 0; i < secretMessage.length(); i+=0) {
        int indexOfPipe = secretMessage.indexOf('|');
        if (indexOfPipe != -1) {
            String secret = secretMessage.substring(i, indexOfPipe);
            char ch = messageTranslator.decode(secret);
            if (ch == '#') {
                ch = ' ';
            }
            toReturn += "" + ch;
            secretMessage = secretMessage.substring(indexOfPipe+1);
        } else {
            char ch = messageTranslator.decode(secretMessage);
            toReturn += "" + ch;
            break;
        }
    }
    //toReturn.replaceAll("#", " ");
    return toReturn;
}

