public static int retrieveOpenCounterWithMostSnrs(Supermarket supermarket) {
    int id = -1;
    int totalCounters = supermarket.getNumCounters();
    double percentage = 0.0;
    for (int i = 1; i <= totalCounters; i++) {
        Counter counter = supermarket.getCounter(i);
        if (counter.getCashier() != null) {
            int queue = counter.getNumCustomersInQueue();
            if (queue > 0) {
                int num = 0;
                for (int j = 1; j <= queue; j++) {
                    Customer customer = counter.getCustomerAtPosition(j);
                    if (customer.getAge() >= 60) {
                        num++;
                    }
                }
                double current = (double)num / (double)queue;
                if (percentage == 0.0 && num > 0) {
                    percentage = current;
                    id = i;
                }
                else {
                    if (current > percentage) {
                        id = i;
                    }
                }
            }
        }
    }
    return id;
}

