public static String translateMessage(MessageTranslator messageTranslator, String secretMessage) {
    String message = "";
    while (!secretMessage.equals("")) {
        if (secretMessage.contains("||") && secretMessage.substring(0,2).equals("||")) {
            message += " ";
            secretMessage = secretMessage.substring(2);
        }
        else {
            if (secretMessage.contains("|")) {
                int pipeIndex = secretMessage.indexOf('|');
                String currentChar = secretMessage.substring(0, pipeIndex);
                if (messageTranslator.decode(currentChar) != '#') {
                    message += messageTranslator.decode(currentChar);
                }
                else {
                    message += " ";
                }

                secretMessage = secretMessage.substring(pipeIndex + 1);   
            }
            else {
                message += messageTranslator.decode(secretMessage);
                secretMessage = "";
            }
        }
    }
    return message;
}

