public static String retrieveStatusOfAllCounters(Supermarket supermarket) {
    int numCounters = supermarket.getNumCounters();
    String counterStatus = "";
    String lastCounterStatus = "";

    for (int i = 1 ; i <= numCounters - 1; i++) {
        Counter counter = supermarket.getCounter(i);
        if (counter.getCashier() == null) {
            counterStatus += i + "-closed,";
        }
        else {
            counterStatus += i + "-open,";
        }
    }
        Counter lastCounter = supermarket.getCounter(numCounters);
        if (lastCounter.getCashier() == null) {
            lastCounterStatus += lastCounter + "-closed";
        }
        else {
            lastCounterStatus += lastCounter + "-open";
        }
        counterStatus += numCounters + lastCounterStatus;  

    return counterStatus;
}

