public static String retrieveStatusOfAllCounters(Supermarket supermarket){

    StringBuffer sb = new StringBuffer("[");

    int numberOfCounters = supermarket.getNumCounters();

    for(int i = 1; i <= numberOfCounters; i++){
        Counter counter = supermarket.getCounter(i);

        String status = "";

        if(counter.getCashier() == null){
            status = "closed";
        }else{
            status = "open";
        }

        sb.append(i+"-"+status);

        if(i != numberOfCounters){
            sb.append(", ");
        }

    }

    sb.append("]");
    return sb.toString();

}

public static int retrieveOpenCounterWithMostSnrs(Supermarket supermarket){

    int numCounter = supermarket.getNumCounters();
    int maxCount = 0;
    Counter toFind = null;

    for(int i = 1; i <= numCounter; i++){
        Counter c = supermarket.getCounter(i);

        int count = 0;
        int numCust = c.getNumCustomersInQueue();

        for(int j = 1; j <= numCust; j++){
            Customer cust = c.getCustomerAtPosition(j);

            if(cust.getAge() >= 60){
                count++;
            }
        }

        if(count > maxCount){
            maxCount = count;
            toFind = c;
        }
    }


    if(maxCount == 0){
        return -1;
    }
    return toFind.getId();
}

