public static Rectangle union(Rectangle rectA, Rectangle rectB){
    int minX;
    int maxX;
    int minY;
    int maxY;
    int dy;
    int dx;
    int bigWidth;
    int bigHeight;

    if(rectA.getX()>rectB.getX()){
        minX = rectB.getX();
        maxX = rectA.getX();
        bigWidth = rectA.getWidth();
    }

    else{
        minX = rectA.getX();
        maxX = rectB.getX();
        bigWidth = rectB.getWidth();
    }

    if(rectA.getY()>rectB.getY()){
        minY = rectB.getY();
        maxY = rectA.getY();
        bigHeight = rectA.getHeight();
    }

    else{
        minY = rectA.getY();
        maxY = rectB.getY();
        bigHeight = rectB.getHeight();
    }

    dx = maxX - minX;
    dy = maxY - minY;

    bigWidth += dx;
    bigHeight += dy;

    Rectangle unionRect = new  Rectangle(minX, minY, bigWidth, bigHeight);  
    return unionRect;
}

