    if(shortestList > a2.size()){
        shortestList = a2.size();
    }
    ArrayList<Integer> merged = new ArrayList<>();
    while(shortestList > 0){
        merged.add(a1.get(0));
        a1.remove(0);
        merged.add(a2.get(0));
        a2.remove(0);
        shortestList--; 
    }
    merged.addAll(a1);
    merged.addAll(a2); 
    a1.clear();
    a1.addAll(merged);
}
