public static Rectangle union(Rectangle rectA, Rectangle rectB) {
    int aMinX = rectA.getX();
    int aMinY = rectA.getY();
    int aMaxX = aMinX + rectA.getWidth();
    int aMaxY = aMinY + rectA.getHeight();

    int bMinX = rectB.getX();
    int bMinY = rectB.getY();
    int bMaxX = bMinX + rectB.getWidth();
    int bMaxY = bMinY + rectB.getHeight();

    int newX = Math.min(aMinX, bMinX);
    int newY = Math.min(aMinY, bMinY);
    int newWidth = Math.max(aMaxX, bMaxX) - newX;
    int newHeight = Math.max(aMaxY, bMaxY) - newY;

    return new Rectangle(newX, newY, newWidth, newHeight);
}
