public static ArrayList interleave(ArrayList<Integer> a1, ArrayList<Integer> a2){
    //This is assuming we can edit a1. Else can just create another list. 
    Iterator<Integer> iter = a2.iterator();
    int count = 1;
    if(a1.size() >= a2.size())
    {
       //loop through the first array and add elements from list 2 after each element
       while(iter.hasNext())
       {
           //insert elements from list2
           a1.add(count, iter.next());

           //make sure elements are getting added at 1, 3, 5, 7, 9, etc
           //if you put if(count <= a1.size()) here you wouldn't need the block below :P
           count = count + 2;
       }
    }
    else if(a1.size() < a2.size())
    {
       //loop through the first array and add elements from list 2 after each element
       while(iter.hasNext())
       {
           if(count <= a1.size())
           {
               //insert elements from list2
               a1.add(count, iter.next());

               //make sure elements are getting added at 1, 3, 5, 7, 9, etc
               count = count + 2;
           }
           else
           {
               //fill in the remainder of the elements from list2 to list1
               a1.add(iter.next());
           }
       }
    }
    return a1;
}

