public static int retrieveOpenCounterWithMostSnrs(Supermarket supermarket) {
    int rtn = 0;
    int totalNumberOfCounters = supermarket.getNumCounters();
    int queuesWithoutSnrs = 0;
    double queueLen = 0.0;
    double snrsInQueue = 0.0;
    double snrsPercentage = 0.0;
    double lastLargestPercentage = 0.0;
    boolean snrCheck = true;

    for(int i = 1; i <= totalNumberOfCounters; i++){
        Counter currentCounter = supermarket.getCounter(i);
        if(currentCounter != null){
            queueLen = currentCounter.getNumCustomersInQueue();
            for(int x = 1; x <= queueLen; x++ ){
                Customer currentCustomer = currentCounter.getCustomerAtPosition(x);
                if(currentCustomer != null){
                    int age = currentCustomer.getAge();
                    if(age>= 60){
                        snrsInQueue++;
                    }
                }
            }// end customer queue for loop
        }
        if (snrsInQueue == 0){
            queuesWithoutSnrs++; // to tally up the queues without seniors 
        }
        if( queueLen != 0){
            snrsPercentage = snrsInQueue/queueLen;
        }
        if(snrsPercentage> lastLargestPercentage){
            rtn = i; //sets the return value to the current counter number 
            lastLargestPercentage = snrsPercentage; //sets the new largest 
        }
        snrsInQueue = 0;// reset value before ending loop
    }//end Counter for loop

    if(queuesWithoutSnrs == totalNumberOfCounters){ //checks if there are any queues with seniors
        snrCheck = false;
    }
    if(!snrCheck){
        rtn = rtn - 1; //for the negative value
    }


    return rtn ;
}

