public static String translateMessage (MessageTranslator translator, String pattern ) {
    String rtn  = "Null Value Entered";
    int lastEnd = 0;
    boolean wasSeperator = false;

    if(translator == null){
        translator = new MessageTranslator();
    }

    if (pattern != null) { // Handles null pointer exception
        rtn = "";
        for (int i = 0; i < pattern.length(); i++) {
            if (i != pattern.length()-1) { // checks if this is the last iteration
                char currentChar = pattern.charAt(i);
                String thisPattern = "";
                // STEP ONE : If this is the start of a next letter, substring from the last end till this one
                if(currentChar == '|'){
                    thisPattern = pattern.substring( lastEnd , i ); //this will not count the latest char, which is a '|'
                    char thisLetter = translator.decode( thisPattern );
                    if (thisLetter != '#') {
                        rtn += thisLetter; // if this is not junk code; add to string
                    }
                    lastEnd = i+1; //this will start the next substring of the next morse pattern, after this '|' char. 
                }
                // STEP TWO : Concats a space where there are two '|'
                if ( (currentChar == '|') && (wasSeperator == true) ) {
                    rtn += ' ';
                }
                // STEP THREE : This section will remind the next iteration if the last char was a '|'
                if (currentChar == '|') {
                    wasSeperator = true;
                }else{
                    wasSeperator = false;
                }
                // STEP FOUR : Else condition handles the last morse code sequence 
            }else{
                String thisPattern = pattern.substring( lastEnd , i+1 );  // +1 to take the last char of the String pattern into consideration.
                char thisLetter = translator.decode( thisPattern ); 
                if (thisLetter != '#') {
                    rtn += thisLetter; //will not concat if this is totally junk code
                }
            }
        }// END LOOP
    }// END if-not-null Condition


    return rtn;  // RETURN STATEMENT 
}

