public static Rectangle union(Rectangle rectA, Rectangle rectB) {


    int minX = Math.min(rectA.getX(), rectB.getX());
    int minY = Math.min(rectA.getY(), rectB.getY());

    int highHeightA = rectA.getHeight() + rectA.getY();
    int highHeightB = rectB.getHeight() + rectB.getY();

    int highestHeight = Math.max(highHeightA, highHeightB);
    int heightReturn = highestHeight - minY;

    int longWidthA = rectA.getWidth() + rectA.getX();
    int longWidthB = rectB.getWidth() + rectB.getX();

    int longestWidth = Math.max(longWidthA, longWidthB);
    int widthReturn = longestWidth - minX;

    Rectangle toReturn = new Rectangle(minX, minY, widthReturn, heightReturn);
    return toReturn;
}

