            toReturn.add(a2.get(i));
        }

    } else if (a1.size() > a2.size()) {
        for (int j = 0; j < a2.size(); j++) {
            toReturn.add(a1.get(j));
            toReturn.add(a2.get(j));
        }
        for (int k = a2.size(); k < a1.size(); k++) {
            toReturn.add(a1.get(k));

        }

    } else {
        for (int m = 0; m < a1.size(); m++) {
            toReturn.add(a1.get(m));
            toReturn.add(a2.get(m));
