			int difference = a2.size() - a1.size(); 
			for(int i=0; i<a1.size(); i++){
				result.add(a1.get(i)); 
				result.add(a2.get(i)); 
			}
			for(int j=0; j<difference; j++){
				result.add(a2.get(a1.size()+ j)); 
			}
		}else{
			int difference = a1.size() - a2.size(); 
			for(int i=0; i<a2.size(); i++){
				result.add(a1.get(i)); 
				result.add(a2.get(i)); 
			}
