public static Rectangle union(Rectangle rectA, Rectangle rectB){
        int Ax = rectA.getX();
        int Ay = rectA.getY();
        int AWidth = rectA.getWidth();
        int AHeight = rectA.getHeight();

        int Bx = rectB.getX();
        int By = rectB.getY();
        int BWidth = rectB.getWidth();
        int BHeight = rectB.getHeight();

        int Cx = Math.min(Ax,Bx);
        int Cy = Math.min(Ay,By);

        int lengthA = Ax + AWidth;
        int lengthB = Bx + BWidth;

        int lengthC = Math.max(lengthA,lengthB);
        int CWidth = lengthC - Cx;

        int heightA = Ay + AHeight;
        int heightB = By + BHeight;

        int heightC = Math.max(heightA,heightB);
        int CHeight = heightC - Cy;

        Rectangle r = new Rectangle(Cx, Cy, CWidth, CHeight);

        return r;
    }

