public static Rectangle union(Rectangle rectA, Rectangle rectB) {
    int x = Math.min(rectA.getX(), rectB.getX());
    int y = Math.min(rectA.getY(), rectB.getY());
    int width = 0;
    if (rectA.getX() > rectB.getX()) {
        width = rectA.getWidth() + (rectA.getX() - rectB.getX());
    }
    else {
        width = rectB.getWidth() + (rectB.getX() - rectA.getX());
    }
    int height = 0;
    if (rectA.getY() > rectB.getY()) {
        height = rectA.getHeight() + (rectA.getY() - rectB.getY());
    }
    else {
        height = rectB.getHeight() + (rectB.getY() - rectA.getY());
    }
    return new Rectangle(x, y, width, height);
}

